import Card from '../Card/Card';
import style from "./Cards.module.css"

export default function Cards({characters, onClose}) {
   return <div className={style.separate}>
      {characters.map((id, name, status, species, gender, image)=>{
         return <Card
         key={id}
         id={id}
         name={name}
         status={status}
         species={species}
         gender={gender}
         image={image}
         onClose={onClose}
         />
      })}
   </div>; 
}
